import React from "react";
import Card from "../../components/Card";
import blog2 from '../../assets/blog2.jpeg';
import './style.css';

const Blog2 = props => {
    return (
        <div>
            <Card>
                <h1>40 LGBTQ+ Books To Read Now & Always</h1>
                <div className = "postedOn">Posted on June 6, 2021</div>
                <img src = {blog2} alt = "image" className = "Image" />
            </Card>
        </div>
    )
};

export default Blog2;
